const download=function(){
	const fn=file.value;
	var el=document.createElement('a');
	el.setAttribute("href","data:text/plain;base64,"+zips[fn]);
	el.setAttribute("download",fn);
	el.style.display="none";
	document.body.appendChild(el);
	el.click();
	document.body.removeChild(el);
}
const info=function(){
	var size="";
	switch(file.value){
		case"57.zip":
			size="100 Yottabytes";
			break;
		case"66.zip":
			size="4 Brontobytes";
			break;
		case"95.zip":
			size="400,000 Geopbytes"
	}
	cont.textContent=`~${size} decompressed.`;
}
